import { useEffect } from "react";
import { auth } from "./services/firebaseConfig"; // Firebase auth import

const App = () => {
  useEffect(() => {
    if (auth) {
      console.log("Firebase Auth initialized successfully!");
    } else {
      console.log("Firebase Auth failed to initialize.");
    }
  }, [auth]);

  return (
    <div>
      <h1>Welcome to My Firebase App</h1>
    </div>
  );
};

export default App;
